import React, { useState } from 'react'
import Map from './components/Map'
import Sidebar from './components/Sidebar'
import Header from './components/Header'
import './App.css'

function App() {
  const [selectedXa, setSelectedXa] = useState(null)
  const [showDanToc, setShowDanToc] = useState(true)
  const [showDiaDiem, setShowDiaDiem] = useState(true)
  const [searchQuery, setSearchQuery] = useState('')

  return (
    <div className="app">
      <Header />
      <div className="app-container">
        <Sidebar 
          selectedXa={selectedXa}
          onXaSelect={setSelectedXa}
          showDanToc={showDanToc}
          showDiaDiem={showDiaDiem}
          onToggleDanToc={() => setShowDanToc(!showDanToc)}
          onToggleDiaDiem={() => setShowDiaDiem(!showDiaDiem)}
          searchQuery={searchQuery}
          onSearchChange={setSearchQuery}
        />
        <Map 
          selectedXa={selectedXa}
          onXaSelect={setSelectedXa}
          showDanToc={showDanToc}
          showDiaDiem={showDiaDiem}
          searchQuery={searchQuery}
        />
      </div>
    </div>
  )
}

export default App
